import mimoticon from '../../assets/mimoticon.png';
import './AboutMe.css';

const AboutMe = (props) => {
	return (
		<section id="aboutMe" className="aboutMe-section">
			<div className="timeline">
				<div className="timeline-item">
					<div className="timeline-dot" />
					<div className="timeline-content">
					<span className="timeline-date">2025.02</span>
					<span className="timeline-text">서울대학교 컴퓨터공학부 졸업</span>
					</div>
				</div>

				<div className="timeline-item">
					<div className="timeline-dot" />
					<div className="timeline-content">
					<span className="timeline-date">2021.02</span>
					<span className="timeline-text">서울과학고등학교 졸업</span>
					</div>
				</div>
			</div>
		</section>
	);
};

export default AboutMe;
